import React from 'react'
import burgerLogo from '../assets/burger-logo.png'
 import classes from './Logo.module.css'
 
const Logo=(props)=>(
    <div className={classes.Logo}>
        <img src={burgerLogo} alt="MyBurger"/>
    </div>
)

export default Logo;
